import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'networkidle' });

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // The profile links are not wired up in the provided JS.
    // We will directly call the function to render the profile page.
    await page.evaluate(() => {
      // This function is defined in the script.js file and renders the profile view
      if (typeof showProfile === 'function') {
        showProfile();
      } else {
        throw new Error('showProfile function not found');
      }
    });

    // Wait for the profile header to be visible
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Harvest the user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.profile-info .username').textContent();
    const bio = await page.locator('.profile-info .bio').textContent();

    const stats = await page.locator('.profile-stats .stat .stat-number').allTextContents();
    const totalOrders = stats[0];
    const totalReviews = stats[1];
    const sellerRating = stats[2];

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim(),
      totalOrders: parseInt(totalOrders, 10),
      totalReviews: parseInt(totalReviews, 10),
      sellerRating: parseFloat(sellerRating)
    };

    return {
      success: true,
      action: "Successfully harvested user profile information by directly invoking the profile page render function.",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
    screenshots.push(path.join(screenshotsDir, 'error_screenshot.png'));

    return {
      success: false,
      action: "Failed to harvest user profile information",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
